import React from 'react';
import Peopleinfo from './Peopleinfo';


const List = ({people}) => {
    return (
        <div>
            {people.map((user, i) => {
                return (<Peopleinfo 
                    key={i} 
                    name={people[i].name}
                    birth_year={people[i].birth_year}
                    height={people[i].height}
                    mass={people[i].mass}/>)
            })
            }
        </div>
    );
}

export default List;
